import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.css';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';

export const CreateNewPost = () => {
return (
<>
<section className="masthead">
   <div className="container">
      <div className="row">
         <div className="col-md-12">
            <h5 className="mb-4">Create New Post</h5>
         </div>
      </div>
      <div className="row">
         <div className="col-lg-12">
            <form>
               <div className="form-group">
                  <textarea className="form-control" rows="10" placeholder="Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book."></textarea>
               </div>
            </form>
         </div>
      </div>
   </div>
</section>
</>
)
}
export default CreateNewPost;
